import dashboard from '../../assets/dev_tracker_dashboard.png';
import tracker from '../../assets/dev_track_tracker.png';

export const project_images = [
   {src: `${dashboard}`, alt: "dashboard"},
   {src: `${tracker}`, alt: "tracker"},
]
